#Manage data for variable 1: Physical Child Abuse
df['Child_Abuse']=df['H4MA3']
df['Child_Abuse'].value_counts()

#Removing Unessasary 
df['Child_Abuse']=df['Child_Abuse'].loc[df['Child_Abuse'] !='']
df['Child_Abuse'].value_counts()

#Removing Values 96, 98
df['Child_Abuse']=df['Child_Abuse'].loc[df['Child_Abuse'] !=' ']
df['Child_Abuse']=df['Child_Abuse'].loc[df['Child_Abuse'] !='6']
df['Child_Abuse']=df['Child_Abuse'].loc[df['Child_Abuse'] !='96']
df['Child_Abuse']=df['Child_Abuse'].loc[df['Child_Abuse'] !='98']
df['Child_Abuse'].value_counts()

#Replacing Names
df['Child_Abuse'].replace(['1', '5','3','2','4'],['ONE TIME','MORE THAN TEN TIMES','THREE TO FIVE TIMES','TWO TIMES', 'SIX TO TEN TIMES'],inplace=True)
df['Child_Abuse'].value_counts()

rp.summary_cat(df['Child_Abuse'])

#Graphs and tables or statistics (For statistics and tables, please see above)
plt.title("Before your eighteenth birthday, how often did a parent or a caregiver hit you with a fist, kick you, or throw you on the floor, into a wall, or downstairs? ")
df['Child_Abuse'].value_counts().plot(kind ='pie', autopct='%1.1f%%', colors=['olivedrab', 'rosybrown', 'gray', 'saddlebrown'])

plt.xlabel("Child_Abuse")
plt.ylabel("Percent")
plt.title("Before your eighteenth birthday, how often did a parent or a caregiver hit you with a fist, kick you, or throw you on the floor, into a wall, or downstairs?")
df['Child_Abuse'].value_counts(normalize = True).plot(kind= 'bar', color = 'red', width = 0.2, alpha = 0.5)

